import React from 'react'

const Paragraph = () => {
  return (
    <section className="paragraph" id='paragraph'>
    <div className='text-black' id='Hero2'> 
    <div className='max-w-[800px] mt-[10px] w-[80%] h-full mx-auto text-center flex flex-col mb-20 justify-center'>    
       <p className='md:text-xl text-lg text-black md:py-3 py-3'>“A case study is a research approach used to generate a deep, multifaceted understanding of a complex topic in its real-life context. It is an established research process that is used in a wide variety of disciplines, particularly in the social sciences” (Crowe, 2011). </p>

        </div>
        </div>
        </section>
  )
}

export default Paragraph;
